import random

def lotto():
    ticket_numbers = []
    while len(ticket_numbers) < 5:
        num = random.randint(1, 69)
        if num not in ticket_numbers:
            ticket_numbers.append(num)

    powerball = random.randint(1, 26)

    return ticket_numbers, powerball

