    ticket_numbers, powerball = lotto()
    print(f"Your winning numbers are: {ticket_numbers} and Powerball {powerball}")

    user_numbers = input("Enter your 5 numbers separated by commas: ").split(',')
    user_numbers = [int(num) for num in user_numbers]
    user_powerball = int(input("Enter Powerball number: "))

    if user_numbers == ticket_numbers and user_powerball == powerball:
        print("Congratulations! You won the lottery!")
    else:
        print("Sorry, you didn't win this time :(")

