def jobs_male_female(international):
    jobs = []
    for company in international['companies']:
        if company['country'] in ['France', 'Germany']:
            female_execs = set(find_female_execs(company['url']))
            male_execs = set(find_male_execs(company['url']))
            jobs.extend(list(female_execs | male_execs))
    return jobs

def find_female_execs(url):
    female_urls = []
    page = requests.get(url).content
    soup = BeautifulSoup(page, 'html.parser')
    executives = soup.find_all('div', class_='executive')
    for exec in executives:
        name = exec.find('h2').text
        if any(name.startswith(prefix) for prefix in ['Miss', 'Mrs.']):
            female_urls.append(url + exec.find('a')['href'])
    return female_urls

def find_male_execs(url):
    male_urls = []
    page = requests.get(url).content
    soup = BeautifulSoup(page, 'html.parser')
    executives = soup.find_all('div', class_='executive')
    for exec in executives:
        name = exec.find('h2').text
        if any(name.startswith(prefix) for prefix in ['Mr.']):
            male_urls.append(exec.find('a')['href'])
    return male_urls

