import re

def get_name(line):
    match = re.search('<td>(.*?)</td>', line)
    return match.group(1)

def get_age(line):
    match = re.search('<td>(\d+)</td>', line)
    return match.group(1)

def parse_record(line):
    name = get_name(line)
    age = get_age(line)

    return (name, age)

def parse_file(filename):
    result = []
    with open(filename) as f:
        lines = f.readlines()
        for line in lines:
            if "Alice" in line:
                record = parse_record(line)
                result.append(record)

    return result

