import os

app = Flask(__name__)

@app.route('/download')
def download():
    attachment_path = request.args.get('path')

    if '..' in attachment_path or os.path.isabs(attachment_path):
        return "Invalid path"

    try:
        with open(attachment_path, 'rb') as f:
            attachment_data = f.read()

        response = make_response(attachment_data)
        response.headers['Content-Type'] = 'application/octet-stream'
        response.headers['Content-Disposition'] = f'attachment; filename="{os.path.basename(attachment_path)}"'

        return response

    except FileNotFoundError as e:
        return "File not found", 404

