from products.models import get_categories

class CategorySelect(MultiWidget):
    def __init__(self, attrs=None):
        widgets = (forms.Select(attrs={'class': 'category-dropdown'}),
                   forms.TextInput(attrs={'class': 'additional-categories'}))
        super(CategorySelect, self).__init__(widgets, attrs)

    def decompress(self, value):
        if value:
            return [value[0], ','.join(value[1:])]
        return [None, '']

    def format_output(self, rendered_widgets):
        return mark_safe('<div class="category-select-widget">{}{}<div class="additional-categories">'.format(rendered_widgets[0], rendered_widgets[1]))

